import React, { useState, useEffect } from "react";
import { Container } from './style';
import api from '../../services/api';

interface IProduct{
    id: number;
    photo: string;
    description: string;
    price: number;
}


const Home: React.FC = () => {
    const [ data, setData ] = useState<IProduct[]>([]);
    useEffect(() => {
        api.get("").then(
            response => {
                setData(response.data)
            }
        )
    }, [])

  return (
      <Container>
         <section>
             { data.map( prod => (
             <div className="product-content" key={prod.id}>
                <img src="https://a-static.mlcdn.com.br/1500x1500/iphone-11-apple-128gb-preto-61-12mp-ios/magazineluiza/155611100/1cd49b14dc8d5d36c597d5d964fc4c73.jpg" alt="iphone" width="200" height="auto" />
                <h4>nome produto</h4>
                <span>descrição</span>
                <h6>price</h6>
             </div>
             )) }

         </section>
      </Container>
  );
}

export default Home;
